import { gql } from "apollo-boost";

export const REGISTER = gql`
  mutation register(
    $name: String!
    $email: String!
    $password: String!
    $phone: String!
    $type: String!
  ) {
    register(
      data: {
        name: $name
        email: $email
        password: $password
        phone: $phone
        type: $type
      }
    ) {
      token
      user {
        id
        name
      }
    }
  }
`;
